open System.IO

let sort_cyclic_shifts(s: string) =
    let s = [| for c in s -> int c |]
    let n = s.Length
    let alphabet = 256
    let p = Array.zeroCreate n
    let mutable c = Array.zeroCreate n
    let cnt = Array.zeroCreate (max alphabet n)
    for i = 0 to n-1 do
        cnt.[s.[i]] <- cnt.[s.[i]] + 1
    for i = 1 to alphabet-1 do
        cnt.[i] <- cnt.[i] + cnt.[i-1]
    for i = 0 to n-1 do
        cnt.[s.[i]] <- cnt.[s.[i]] - 1
        p.[cnt.[s.[i]]] <- i
    c.[p.[0]] <- 0
    let mutable classes = 1
    for i = 1 to n-1 do
        if s.[p.[i]] <> s.[p.[i-1]] then
            classes <- classes + 1
        c.[p.[i]] <- classes - 1
    let mutable pn = Array.zeroCreate n
    let mutable cn = Array.zeroCreate n
    let mutable h = 0
    while (1 <<< h) < n do
        for i = 0 to n-1 do
            pn.[i] <- p.[i] - (1 <<< h)
            if pn.[i] < 0 then
                pn.[i] <- pn.[i] + n
        for i = 0 to classes-1 do
            cnt.[i] <- 0
        for i = 0 to n-1 do
            cnt.[c.[pn.[i]]] <- cnt.[c.[pn.[i]]] + 1
        for i = 1 to classes-1 do
            cnt.[i] <- cnt.[i] + cnt.[i-1]
        for i = n-1 downto 0 do
            cnt.[c.[pn.[i]]] <- cnt.[c.[pn.[i]]] - 1
            p.[cnt.[c.[pn.[i]]]] <- pn.[i]
        cn.[p.[0]] <- 0
        classes <- 1
        for i = 1 to n-1 do
            let cur = (c.[p.[i]], c.[(p.[i] + (1 <<< h)) % n])
            let prev = (c.[p.[i-1]], c.[(p.[i-1] + (1 <<< h)) % n])
            if cur <> prev then
                classes <- classes + 1
            cn.[p.[i]] <- classes - 1
        let temp = c
        c <- cn
        cn <- temp
        h <- h + 1
    p

// returns the suffix array of s
let suffix_array_construction(s) =
    sort_cyclic_shifts(s + "\000").[1..]

// returns the lcp array of s given the suffix array
let lcp_construction(s: string, sa: int[]) =
    let n = s.Length
    let rank = Array.zeroCreate n
    //printfn "%A .. %A" 
    for i = 0 to n-1 do
        rank.[sa.[i]] <- i
    let mutable k = 0
    let lcp = Array.zeroCreate (n-1)
    let mutable skip = false
    for i = 0 to n-1 do
        skip <- false
        if rank.[i] = n-1 then
            k <- 0
            skip <- true
        if not skip then
            let j = sa.[rank.[i]+1]
            while i + k < n && j + k < n && s.[i+k] = s.[j+k] do
                k <- k + 1
            lcp.[rank.[i]] <- k
            if k <> 0 then
                k <- k - 1
    Array.append [| 0 |] lcp

// returns a pair of upper and lower bound, both inclusive
let string_matching(s: string, p: string, sa: int[]) =
    let m = p.Length
    let mutable lo = 0
    let mutable hi = s.Length - 1
    while lo < hi do
        let mid = (lo+hi) / 2
        if s.[sa.[mid]..].[..m-1] >= p then
            hi <- mid
        else
            lo <- mid+1
    if s.[sa.[lo]..].[..m-1] <> p then
        (-1, -1)
    else
        let l = lo
        lo <- 0
        hi <- s.Length - 1
        while lo < hi do
            let mid = (lo+hi) / 2
            if s.[sa.[mid]..].[..m-1] > p then
                hi <- mid
            else
                lo <- mid + 1
        if s.[sa.[hi]..].[..m-1] <> p then
            hi <- hi - 1
        (l, hi)

let s = "$"
let query = ""

let sa = suffix_array_construction(s)
let lcp = lcp_construction(s, sa)

